import React, {Component} from 'react';

class Statee extends Component {
    constructor(props){
        super(props)
        this.state = {
            ad: "malik"
        }
    }
    render() {
        return (
            <div>
                {this.state.ad}
            </div>
        )
    }
}

export default Statee;
